import './App.css';

function App() {
  return (
    <div className='w-2/3 flex justify-center items-center'>
    <div className="m-10 w-max-lg bg-gray-100 broder rounded-lg drop-shadow-lg">
      <div className="flex justify-center items-center">
        <a className=" text-gray-500 py-3"> Airplane	seating	algorithm </a>
      </div>
    </div>
    </div>
  );
}

export default App;
